import React from 'react'

function ExpenseDetails({ incomeAmt, expenseAmt }) {
    return (
        <div>
            <div className='text-xl pt-5 lg:pt-10'>
                Your Balance is ₹ {incomeAmt - expenseAmt}
            </div>
            {/* Show Income & Expense amount */}
            <div className="amounts-container font-medium flex items-center justify-center space-x-4">

                <span className="income-amount">Income <span></span>₹{incomeAmt}</span>

                <span className="expense-amount">Expense ₹{expenseAmt}</span>
            </div>
        </div>
    )
}

export default ExpenseDetails
